import React,{login} from 'react';
import'./style.css';

/**
* @author
* @function SignUp
**/

const SignUp = (props) => {
   login()
   {
     alert('loged in successful')
   }
  return(
    <div>
      <input type="text" /> <br/> <br/>
      <input type="text" /> <br/> <br/>
      <button onClick={()=>this.login()}></button>
    
    </div>
   )

 }

export default SignUp;
